import React, { useState } from "react";
import "./assetRegister.css"; // Import the CSS file for styling

const AssetRegister = () => {
  const [name, setName] = useState("");
  const [company, setCompany] = useState("");
  const [department, setDepartment] = useState("");
  const [category, setCategory] = useState("");
  const [assetName, setAssetName] = useState("");

  const handleClick = () => {
    if (!name || !company || !department || !category || !assetName) {
      alert("Please fill in all fields before generating the asset.");
      return;
    }

    const assetData = {
      name,
      company,
      department,
      category,
      assetName,
    };

    console.log("Asset Data: ", assetData);
    alert("Asset Registered Successfully!");

    // Clear the input fields
    setName("");
    setCompany("");
    setDepartment("");
    setCategory("");
    setAssetName("");
  };

  return (
    <div className="asset-register">
      <div className="form-container">
        <h2>Asset Registration</h2>
        <div className="input-box">
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            placeholder="Enter your Name"
          />
          <input
            type="text"
            value={company}
            onChange={(e) => setCompany(e.target.value)}
            placeholder="Enter Company"
          />
          <input
            type="text"
            value={department}
            onChange={(e) => setDepartment(e.target.value)}
            placeholder="Enter Department"
          />
          <input
            type="text"
            value={category}
            onChange={(e) => setCategory(e.target.value)}
            placeholder="Enter Asset Category"
          />
          <input
            type="text"
            value={assetName}
            onChange={(e) => setAssetName(e.target.value)}
            placeholder="Enter Asset Name"
          />
          <button className="button" onClick={handleClick}>
           S
          </button>
        </div>
      </div>
    </div>
  );
};

export default AssetRegister;
